import React from 'react'
import { Grid } from '@material-ui/core';



export const JobCard = ({job}) => {

 
    const {company} = job;

    return (
        <div >
 
            
            <Grid container>

                <Grid item sm={12}  xs={1} border={1} alignItems="center">
                            {company}
                </Grid>
               
            </Grid>
            
           

        </div>
    )
}
